import React from 'react';
import { SvgIcon } from '@material-ui/core';
import LightningIcon from '@material-ui/icons/Lightning';
import './MyComponent.css';

const TopNav = () => {
  return (
    <div className="my-component">
      <h1>
        <SvgIcon component={LightningIcon} viewBox="0 0 24 24" color="primary" />
        Hello, Voiceflow Functions!
      </h1>
      <p>This is a custom integration with Voiceflow Functions.</p>
    </div>
  );
};

export default TopNav;
